CREATE DEFINER=`root`@`localhost` PROCEDURE `reporteMay`(mesI int, mesF int, ano int)
BEGIN
SELECT est.nombre_estbnto AS establecimiento,
       maq.idMaquina AS maquina,
       concat(uest.calle_ue, ' calle', uest.avenida_ue, ' avenida', ' ', uest.casa_ue, ' zona ', uest.zona_ue, ' ', uest.municipio_ue, ' ', uest.departamento_ue) AS direccion,
       sum(ven.monto_vta) AS venta,
       (est.valorporcentaje_estbnto * sum(ven.monto_vta)/100) AS gananciaEstablecimiento,
       sum(ven.monto_vta)-(est.valorporcentaje_estbnto * sum(ven.monto_vta)/100) AS diferencia
FROM ubicacion_establecimiento uest
INNER JOIN establecimiento est ON est.idestablecimiento = uest.establecimiento_idUbicacionEstablecimientos
INNER JOIN maquina maq ON est.idEstablecimiento = maq.Establecimiento_idEstablecimientos
INNER JOIN venta ven ON maq.idMaquina = ven.maquina_idMaquina
AND year(ven.fecha_vta) = ano
AND month(ven.fecha_vta) BETWEEN mesI AND mesF
AND est.tipo_estbnto = 'May'
AND maq.estado_mqna = 'A'
GROUP BY est.idEstablecimiento; END ;;
