CREATE DEFINER=`root`@`localhost` PROCEDURE `reporteVentasRepartidor`(mes int, ano int)
BEGIN

SELECT re.nombre_rpdr Nombre_Repartidor,
       ru.idRuta IdRuta,
       ru.nombre_ruta Ruta,
       sum(monto_vta) Monto_Venta,
       ba.nombre_bco Banco,
       ba.montotransaccion_bco Deposito
FROM repartidor re
INNER JOIN ruta ru ON re.idrpdr = ru.repartidor_idrpdr
INNER JOIN establecimiento es ON es.Ruta_idRuta = ru.idRuta
INNER JOIN maquina ma ON ma.Establecimiento_idEstablecimientos = es.idEstablecimiento
INNER JOIN venta ve ON ve.maquina_idMaquina = ma.idMaquina
INNER JOIN banco ba ON ba.repartidor_idrpdr = re.idrpdr
WHERE re.estadolaboral_rpdr = 'activo'
  AND idEstablecimiento <> 0
  AND month(ve.fecha_vta) = mes
  AND year(ve.fecha_vta) = ano
  AND month(ba.fechatransaccion_bco) = mes
  AND year(ba.fechatransaccion_bco) = ano
GROUP BY re.nombre_rpdr,
         ru.idRuta;
END ;;
